/********************************************************************
* FUNCTION core_model_network_element_ltp_lp_mro
* 
* Make read-only child nodes
* Path: /network-element/ltp/lp
* 
* INPUTS:
*     parentval == the parent struct to use for new child nodes
* 
* RETURNS:
*     error status
********************************************************************/
static status_t
    core_model_network_element_ltp_lp_mro (val_value_t *parentval)
{
    status_t res = NO_ERR;
    val_value_t *childval = NULL;
    

    /* add /network-element/ltp/lp/operational-state */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_operational_state,
        core_model_network_element_ltp_lp_operational_state_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    /* add /network-element/ltp/lp/administrative-state */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_administrative_state,
        core_model_network_element_ltp_lp_administrative_state_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    return res;

} /* core_model_network_element_ltp_lp_mro */


