/********************************************************************
* FUNCTION core_model_network_element_ltp_mro
* 
* Make read-only child nodes
* Path: /network-element/ltp
* 
* INPUTS:
*     parentval == the parent struct to use for new child nodes
* 
* RETURNS:
*     error status
********************************************************************/
static status_t
    core_model_network_element_ltp_mro (val_value_t *parentval)
{
    status_t res = NO_ERR;
    val_value_t *childval = NULL;
    

    /* add /network-element/ltp/operational-state */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_operational_state,
        core_model_network_element_ltp_operational_state_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    /* add /network-element/ltp/administrative-state */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_administrative_state,
        core_model_network_element_ltp_administrative_state_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    return res;

} /* core_model_network_element_ltp_mro */


