/********************************************************************
* FUNCTION core_model_network_element_mro
* 
* Make read-only child nodes
* Path: /network-element
* 
* INPUTS:
*     parentval == the parent struct to use for new child nodes
* 
* RETURNS:
*     error status
********************************************************************/
static status_t
    core_model_network_element_mro (val_value_t *parentval)
{
    status_t res = NO_ERR;
    val_value_t *childval = NULL;
    

    /* add /network-element/operational-state */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_operational_state,
        core_model_network_element_operational_state_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    /* add /network-element/administrative-state */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_administrative_state,
        core_model_network_element_administrative_state_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    return res;

} /* core_model_network_element_mro */


