/********************************************************************
* FUNCTION core_model_forwarding_construct_fc_port_mro
* 
* Make read-only child nodes
* Path: /forwarding-construct/fc-port
* 
* INPUTS:
*     parentval == the parent struct to use for new child nodes
* 
* RETURNS:
*     error status
********************************************************************/
static status_t
    core_model_forwarding_construct_fc_port_mro (val_value_t *parentval)
{
    status_t res = NO_ERR;
    val_value_t *childval = NULL;
    

    /* add /forwarding-construct/fc-port/is-internal-port */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_is_internal_port,
        core_model_forwarding_construct_fc_port_is_internal_port_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    /* add /forwarding-construct/fc-port/operational-state */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_operational_state,
        core_model_forwarding_construct_fc_port_operational_state_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    /* add /forwarding-construct/fc-port/administrative-state */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_administrative_state,
        core_model_forwarding_construct_fc_port_administrative_state_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    return res;

} /* core_model_forwarding_construct_fc_port_mro */


