/********************************************************************
* FUNCTION core_model_equipment_mro
* 
* Make read-only child nodes
* Path: /equipment
* 
* INPUTS:
*     parentval == the parent struct to use for new child nodes
* 
* RETURNS:
*     error status
********************************************************************/
static status_t
    core_model_equipment_mro (val_value_t *parentval)
{
    status_t res = NO_ERR;
    val_value_t *childval = NULL;
    

    /* add /equipment/is-field-replaceable */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_is_field_replaceable,
        core_model_equipment_is_field_replaceable_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    /* add /equipment/operational-state */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_operational_state,
        core_model_equipment_operational_state_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    /* add /equipment/administrative-state */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_core_model_N_administrative_state,
        core_model_equipment_administrative_state_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    return res;

} /* core_model_equipment_mro */


