/********************************************************************
* FUNCTION y_core_model_init2
* 
* SIL init phase 2: non-config data structures
* Called after running config is loaded
* 
* RETURNS:
*     error status
********************************************************************/
status_t y_core_model_init2 (void)
{
    status_t res = NO_ERR;

    equipment_val = agt_init_cache(
        y_core_model_M_core_model,
        y_core_model_N_equipment,
        &res);
    if (res != NO_ERR) {
        return res;
    }

    forwarding_construct_val = agt_init_cache(
        y_core_model_M_core_model,
        y_core_model_N_forwarding_construct,
        &res);
    if (res != NO_ERR) {
        return res;
    }

    network_element_val = agt_init_cache(
        y_core_model_M_core_model,
        y_core_model_N_network_element,
        &res);
    if (res != NO_ERR) {
        return res;
    }

    operation_envelope_val = agt_init_cache(
        y_core_model_M_core_model,
        y_core_model_N_operation_envelope,
        &res);
    if (res != NO_ERR) {
        return res;
    }

    res = u_core_model_init2();

    return res;
} /* y_core_model_init2 */

